import React from "react";

const Comment = ({ comments }) => {
  return comments.map(item => {
    return (
      <div key={item.id}>
          <ul>
                <li>{item.name}</li>
          </ul>
      </div>
    );
  });

};

const Section = ({section }) =>{

    return section.map()
}





export default Comment;
